import React, { Component } from "react";
import Images from './Images';

class List extends Component {

    render(){
        return(
            <div>
                <Images/>
                <ol>
                    <li>1 <Images linkgambar = "https://foto.co.id/wp-content/uploads/2016/12/Teknik-foto-makanan.jpg" /></li>
                    <li>2 <Images linkgambar = "https://awsimages.detik.net.id/community/media/visual/2020/04/27/332078fd-4bc6-42b8-917c-457b0af2fc54_169.jpeg?w=620" /></li>
                    <li>3 <Images linkgambar = "https://img.okezone.com/content/2016/10/14/298/1515199/kuliner-khas-nusantara-ini-yang-menentukan-kelezatan-masakan-khas-bali-5NsQa5bIGO.jpg" /></li>
                    <li>4 <Images linkgambar = "https://cdn1.katadata.co.id/media/images/temp/2021/09/09/Nasi_Timbel-2021_09_09-11_38_01_2d40695cd31db0ac2a11afcf7cbc4ed7.jpg" /></li>
                </ol>
            </div>
        );
    }
}

export default List;
